import React from "react";

import RadioButtonUncheckedIcon from "@material-ui/icons/RadioButtonUnchecked";

function App() {
  return (
    <div className="wrapper">
      <div className="field-item">
        <RadioButtonUncheckedIcon />
      </div>
    </div>
  );
}

export default App;
